"""
1289. Minimum Falling Path Sum II

Given a square grid of integers arr, a falling path with non-zero shifts is a choice of exactly one element from each row of arr, such that no two elements chosen in adjacent rows are in the same column.

Return the minimum sum of a falling path with non-zero shifts.

Example 1:

Input: arr = [[1,2,3],[4,5,6],[7,8,9]]
Output: 13
Explanation:
The possible falling paths are:
[1,5,9], [1,5,7], [1,6,7], [1,6,8],
[2,4,8], [2,4,9], [2,6,7], [2,6,8],
[3,4,8], [3,4,9], [3,5,7], [3,5,9]
The falling path with the smallest sum is [1,5,7], so the answer is 13.


Constraints:

1 <= arr.length == arr[i].length <= 200
-99 <= arr[i][j] <= 99

Sol
Time O(n^2)
Space O(1)
Let arr[i][j] be the min sum if we picked arr[i][j] as part of our solution
for each row r, get the least 2 for previous row r-1, if current value's column = previous picked value's column, pick next larger value instead
"""
from typing import List


class Solution:
    def minFallingPathSum(self, arr: List[List[int]]) -> int:
        n = len(arr)
        for i in range(1, n):
            # find least two element in O(n), could use headq.nsmallest(2, arr[i-1]) as well, but in theory it is nlogn
            leastTwo = [min(arr[i - 1])]
            index = arr[i-1].index(leastTwo[0])
            arr[i-1][index] = 99*i
            leastTwo.append(min(arr[i-1]))
            arr[i-1][index] = leastTwo[0]
            for j in range(0, n):
                arr[i][j] += leastTwo[0] if arr[i-1][j] != leastTwo[0] else leastTwo[1]
        return min(arr[-1])



